import logo from './logo.svg';
import './App.css';
import HeroSection from './Components/HeroSection';
import TestimonialSlider from './Components/TestimonialSlider';
import CustomNavbar from './Components/navbar';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HeroSection/>
        <TestimonialSlider/>
      </header>
    </div>
  );
}

export default App;
